    def print_data(data):
        print("Clues:")
        print("Accross:")
        for clue in data['clues']['across']:
            print( clue['id'], ": ", clue['text'])
        print("Down:")
        for clue in data['clues']['down']:
            print( clue['id'], ": ", clue['text'])
        print("Cells:", end=" ")
        for cell_id in data['cells']:
            if cell_id % 5 == 0:
                print("\n", end=" ")
            cell = data['cells'][cell_id]
            if cell['block']:
                print( " ", end=" ")
            else:
                print( cell['text'], end=" ")
        print("\n", end=" ")

    def print_grid(data):
        for cell_id in data['cells']:
            if cell_id % 5 == 0 and cell_id > 0:
                print("\n", end="")
            cell = data['cells'][cell_id]
            if cell['block']:
                print( " ", end=" ")
            else:
                print( cell['text'], end=" ")
        print("\n", end=" ")


    def print_clues(data):
        def get_answer(cells, across, id):
            res = ""
            for row in range(5):
                for col in range (5):
                    cell = cells[row*5+col]
                    if id == cell['number']:
                        while( row < 5 and col < 5):
                            cell = cells[row*5+col]
                            if not (cell['block']):
                                res += cell['text']
                            if across:
                                col += 1
                            else:
                                row += 1
                        return res

        print("Accross:")
        for clue in data['clues']['across']:
            print( clue['id'], ": ", clue['text'], ": ", end="")
            print(get_answer(data['cells'], True, clue['id']))
            #get_answer(data['cells'], True, clue['id'])
        print("Down:")
        for clue in data['clues']['down']:
            print( clue['id'], ": ", clue['text'], ": ", end="")
            print(get_answer(data['cells'], False, clue['id']))
